import React, {Component} from 'react';
import "./Header.css";

export class Header extends Component {
    render() {
        return (
            <div>
                <Header1/>
                <Header2/>
            </div>
        );
    }
}

class Header1 extends Component {
    render() {
        return (
            <div className="boxContainer">
                <div id="header">
                    We provide diagnostic imaging informatics solutions.
                </div>
            </div>
        );
    }
}

class Header2 extends Component {
    static get addressList() {
        return ["İstanbul Üniversitesi Cerrahpaşa Avcılar Yerleşkesi Teknokent Binası, 34320 Avcılar/İstanbul, Turkey",
            "4874 10th Street NW, Rochester, MN 55901, USA"];
    }

    render() {
        return (
            <div className="boxContainer" style="--backgroundColor:#F2F2F2">
                <ul id>
                    {Header2.addressList.map(address => (<li>{address}</li>))}
                </ul>
            </div>
        );
    }
}

export default Header;
